class Solution:
    def subarraysDivByK(self, A, K) -> int:
        if not A:
            return 0
        res = 0
        for i in range(len(A)):
            for j in range(i, len(A)+1):
                if A[i:j]:
                    tem = sum(A[i:j])
                    if tem % K == 0:
                        print(tem)
                        print(A[i:j])
                        res += 1
        return res

    def subarraysDivByK2(self, A, K) -> int:
        if not A:
            return 0
        res = 0

        for i in range(len(A)):
            tem = A[i]
            if tem % K == 0:
                res += 1
            for j in range(i+1, len(A)):
                tem += A[j]
                if tem % K == 0:
                    res += 1
        return res

    def subarraysDivByK3(self, A, K) -> int:
        if not A:
            return 0
        res_dict = {}
        res = 0
        min_l = float('inf')
        max_l = -float('inf')

        for i in range(len(A)):
            tem = A[i]
            if tem in res_dict:
                res_dict[tem] += 1
            else:
                if tem > max_l:
                    max_l = tem
                if tem < min_l:
                    min_l = tem
                res_dict[tem] = 1
            for j in range(i + 1, len(A)):
                tem += A[j]
                if tem in res_dict:
                    res_dict[tem] += 1
                else:
                    if tem > max_l:
                        max_l = tem
                    if tem < min_l:
                        min_l = tem
                    res_dict[tem] = 1

        init = 0
        while(init <= max_l):
            if init in res_dict:
                res += res_dict[init]
            init += K
        init = -K
        while(init >= min_l):
            if init in res_dict:
                res += res_dict[init]
            init -= K

        return res

    def subarraysDivByK4(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        pre_sum, res = 0, 0
        dic = {0: 1}

        for val in A:
            pre_sum = (pre_sum + val) % K
            if pre_sum in dic:
                res += dic[pre_sum]
            dic[pre_sum] = dic.get(pre_sum,0) + 1
        return res


