    def subarraysDivByK5(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        s = 0
        B = [0] * K
        for i in A:
            s += i
            B[s % K] += 1
        res = B[0] * (B[0] + 1) / 2
        for b in B[1:]:
            if b > 1:
                res += b * (b - 1) / 2
        print(B)
        return int(res)



